	[script]
	id="dialog_2"
		[modification]
		on_process="[speech_dialog(self, set(level.zoom, 2), music('MilgramSwagger.ogg'),
									[~A moment of your time sir?~],
									set(level.player.animation, 'emote_raisedfinger'),
									level.player, [~Sorry, I'm off to town!~],
									self, [~But the town is under attack!~],
									set(level.player.animation, 'emote_confused'),
									level.player, [~Huh?~,~What's the deal?~],
									self, [~Here's the story.~], [~You know how Milgram loaned~,~a bunch of money to the elder~,~back in the day?~],[~And how the elder never paid up?~],
									set(level.player.animation, 'emote_geez'),
									level.player,[~Yeah...~,~I think I see where this is going.~],
									self, [~Milgram came to collect!~], [~He's cordoned off the town,~,~and won't let anyone leave until~,~he's paid in full.~], [~He's even threatened to kill!~],
									set(level.player.animation, 'emote_impatient'),
									level.player,[~Yeesh.~,~Well, I suppose *someone*~,~has to deal with it.~],
									self, [~We'd be very grateful!~],
									set(level.player.animation, 'emote_talk'),
									level.player,[~Of course...~],
									set(level.player.animation, 'emote_raisedfinger'),
									[~Tell you what;~,~I'll deal with it, and you~,~just pay me whatever you~,~were gonna pay Milgram.~],
									self, [~Uhm.~], [~That's a very odd deal.~], [~ ~], [~I suppose I can't say no,~,~though, can I?~], [~Very well.~,~Please do whatever you can.~],
									set(level.player.animation, 'emote_raisedfinger'),
									level.player, [~Don't worry, I don't disappoint!~],
									self, [~Right then.  I'll be seeing you.~],
									music('FrogattoChill.ogg'), set(level.zoom, 1),
									facing(1),animation('fly_up'),
									set(level.player.vars.triggered_events, level.player.vars.triggered_events + ['berds-first-speech'])),
		
		
		end_script()]"
		target="get_object(level,'berd_man')"
		[/modification]

	[/script]

